import React from 'react';
import { Link } from 'react-router-dom';

export const Footer = () => {
  const footerNav = [
    { label: "Messagerie", path: "/messagerie/123" },
    { label: "Email", path: "/email/123" }
  ];

  return ( // ✅ Ce return est dans la fonction Footer
    <ul>
      {footerNav.map((menu, key) => (
        <li key={key}>
          <Link to={menu.path}>{menu.label}</Link>
        </li>
      ))}
    </ul>
  );
};
